description:
Orient Thai, operates a fleet of Boeing 747s on flights across Asia. Routes include Bangkok to Seoul as well as service into Hong Kong from various cities in Thailand.


This program takes you on a roundtrip from Bangkok to Seoul&amp;#039;s Incheon Airport in South Korean followed by 2 roundtrips from Bangkok to Chep Lap Kok International Airport in Hong Kong with the later one returning to Phuket.

You will be in the cockpit to watch the pilots at work. Included is a presentation of the cockpit by the Captain, First Officer and Flight Engineer. On several occasions we visit the cabin for a look at the airline inflight service and one of the two flights from Bangkok to Hong Kong is filmed from the aircraft&amp;#039;s upper deck cabin.
